import React from 'react';
import { Container, Row, Col } from 'reactstrap';

export default class Content extends React.Component {
  render() {
    return (
      <Container>
        <Row>
          <Col xs="6">.col-6</Col>
          <Col xs="6">.col-6</Col>
        </Row>
        
      </Container>
    );
  }
}
